  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Plant Buddy
        </p>
      <Router>
        <Route path="/registration" exact render={(props) => <Registration />} />
        <Route path="/" exact render={(props) => <Main />} />
      </Router>

      </header>

    </div>

  );
}

export default App;
